const Profile = ({contacts}) => {
    return (
        <div>
            <center><h1>Customer</h1></center>
            {customer.map((cus) => (
                <div class="card">
                    <div class="card-body">
                        <h5 class="card-title">{contact.user.First_name}</h5>
                        <h6 class="card-subtitle mb-2 text-muted">{contact.user.email}</h6>
                        <p class="card-text">{contact.id}</p>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Profile
